import React from "react";
import Navbar from "../components/Navbar";
import image1 from "client/src/assets/TREEPEEPS.png";

function HomePage(){
return(
    <div>
        <Navbar />
        <div style={{ 
      backgroundImage: `url(${Image1})`
    }}></div>
    <div>
        <h1>TreePeeps</h1>
    </div>
    </div>

)
}

export default HomePage;
